  \"2015-02-04T19:38:33.854623\",\n\t\"name\": \"311-service-requests-rodent-baiting-9f9be\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"All open rodent baiting requests and rat
  complaints made to 311 and all requests completed since January 1, 2011. The Department
  of Streets & Sanitation investigates reported rat sightings. Alley conditions are
  examined. If any damaged carts are identified, Sanitation Ward Offices, which distribute
  the carts are notified. Rodenticide is placed in rat burrows to eradicate nests.
  311 sometimes receives duplicate rat complaints and requests for rodent baiting.
  Requests that have been labeled as Duplicates are in the same geographic area and
  have been entered into 311u2019s Customer Service Requests (CSR) system at around
  the same time as a previous request. Duplicate reports/requests are labeled as such
  in the Status field, as either \"Open - Dup\" or \"Completed - Dup.\" Data is updated
  daily.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
